import React from "react";
import MenuItem from "../menu-item/menu-item.component";
import './directory.styles.scss';

class Directory extends React.Component {
    constructor() {
        super();

            this.state = {
                sections: [
                    {
                        title: 'Fertilizers',
                        imageUrl: 'https://www.gettyimages.com/detail/photo/yellow-gloved-hand-holding-a-green-scoop-with-royalty-free-image/93478217?adppopup=true',
                        id: 1
                    },
                    {
                        title: 'Pest Control',
                        imageUrl: '',
                        id: 2
                    },
                    {
                        title: 'Seeds',
                        imageUrl: '',
                        id: 3
                    },
                    {
                        title: 'Crop Protection',
                        imageUrl: '',
                        id: 4
                    },
                    {
                        title: 'Organic and Specialty Products',
                        imageUrl: '',
                        id: 5
                    }
                ]
            }
    }

    render() {
        return (
            <div className="directory-menu">
                {
                    this.state.sections.map(({title, imageUrl, id}) => (
                        <MenuItem key={id} title={title} imageUrl={imageUrl} />
                    ))
                }
            </div>
        );
    }
}

export default Directory;
